import React from 'react';
import './Information.css'
const Information = () => {
    return(
        
        <div className='content'>
            <h2>Hello, our product is awesome</h2>
            <h1>We are students from GMU and VCU coming to HooHacks 2024 to learn something new!</h1>
            <h3>Very grateful for this amazing opportunity!</h3>
        </div>
        
    );
};
export default Information;
